import React from "react";
import styles from "./leistungen.module.scss";
import { Header } from "../components/Header";
import Head from "next/head";
export default function Leistungen() {
  return (
    <div>
      <Head>
        <title>Leistungen</title>

        <link rel="icon" href="/favicon.ico" />
        <link
          href="https://fonts.googleapis.com/icon?family=Material+Icons"
          rel="stylesheet"
        ></link>
      </Head>
      <Header />
      <h1>Umfassende Unterstützung bei ihren Beschwerden</h1>
      Hausbesuche CMD Kiefergelenktherapie Fango Behandlung Heißluft Manuelle
      Therapie Massagen Magränetherapie Schlingentisch Therapie nach Bobath
      Lymphdrainage
    </div>
  );
}
